import React, { useEffect } from "react";
import { useDrop } from "react-dnd";
import { addTeamToAlliance } from "../helpers/functionallity/teamAlliance";
import { getTeamBelongToThisAlliance } from "../helpers/Api/helperApis";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemText from "@mui/material/ListItemText";
import ListItemAvatar from "@mui/material/ListItemAvatar";
import Avatar from "@mui/material/Avatar";
import alliances from "../reducers/alliances";
function Alliance(props) {
  const [{ isOver }, drop] = useDrop(() => ({
    accept: "team",
    drop: (item) => {
      addTeamToAlliance(item.team, props.alliance);
    },
  }));
  let teams = JSON.parse(localStorage.getItem(`${props.alliance.id}`)) || [];
  console.log(teams, "teamssssssss");

  useEffect(async () => {}, []);
  return (
    <List
      className="alliance"
      ref={drop}
      style={{ "margin-left": "63px", "    margin-left": "63px" }}
    >
      {teams.map((team) => {
        return <div style={{ marginBottom: "12" }}> {team.Name}</div>;
      })}
    </List>
  );
}
export default Alliance;
